import React from 'react';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import './index.css';
import { Layout, Menu, Breadcrumb } from 'antd';
import { Button } from 'antd';
import {
    DesktopOutlined,
    PieChartOutlined,
    FileOutlined,
    TeamOutlined,
    UserOutlined,
} from '@ant-design/icons';

const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;
function App() {
  return (
      <Layout style={{ minHeight: '100vh' }}>
          <Header>
              Tobi pizda
          </Header>
          <Layout >
              <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
                  <Menu.Item key="1" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      <Button theme="dark">Up</Button>
                      BTC
                      <Button>Down</Button>
                  </Menu.Item>
                  <Menu.Item key="2" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      <Button>Up</Button>
                      Ripple
                      <Button>Down</Button>
                  </Menu.Item>
                  <Menu.Item key="3" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      <Button>Up</Button>
                      Eth
                      <Button>Down</Button>
                  </Menu.Item>
                  <Menu.Item key="4" style={{ display: 'inline-flex', justifyContent: 'center'}}>
                      <Button>Up</Button>
                      Azaza
                      <Button>Down</Button>
                  </Menu.Item>
              </Menu>
          </Layout>
          <Footer>
              Tobi Pizda
          </Footer>
      </Layout>
  );
}

export default App;
